        switchID = listCond.switch;
        varID = listCond.variable;
        oldValue = $gameVariables.value(varID);
        switchStat = $gameSwitches.value(switchID);
        /*Check result*/
        if (switchStat) {
            $gameVariables.setValue(varID, ++oldValue);
            $gameSwitches.setValue(switchID, 0);
